import { connect } from 'react-redux'
import GameStats from '../components/GameStats'
import {
clockTimer
} from '../Actions';

const mapDispatchToProps = dispatch => {
    return {
        clockTimer: () => {
            dispatch(clockTimer());
        },
    }
}
const BoardGame = connect(
    mapDispatchToProps
)(GameStats);

export default BoardGame
